import React from "react"
import { EnvironmentManager } from "source/plugins/@utils/EnvManager"
import isNodeEnvironment from "source/plugins/@utils/isNodeEnv"

interface img64Props {
  url64: string | undefined
  alt: string
  className?: string
  width?: number
  height?: number
}

const getDefaultImg = (dev: boolean | undefined, width: number, height: number) => {
  return dev
    ? `https://placecats.com/${width}/${height}`
    : ``
}

function ImageComponent({ url64, alt, className, width = 60, height = 60 }: img64Props): JSX.Element {
  const isNodeEnv = isNodeEnvironment()
  const envManager = EnvironmentManager.getInstance()
  const env = envManager.getEnv()
  const dev = env.dev
  const imageUrl = `${isNodeEnv ? "data:image/jpeg;base64," : ""}${url64}`

  if (isNodeEnv) {
    return (
      <img
        src={imageUrl ?? getDefaultImg(dev, width, height)}
        alt={alt}
        data-name={alt}
        {...(className && { className })}
        width={width}
        height={height}
      />
    )
  }

  const NextImage = require("next/image").default
  return (
    <NextImage
      src={imageUrl ?? getDefaultImg(dev, width, height)}
      alt={alt}
      data-name={alt}
      {...(className && { className })}
      width={width}
      height={height}
    />
  )
}

export default ImageComponent
